import React, { Component } from 'react';


export default class Counter extends Component {
    state = { 
        value:20
     }
     getBadge(){
         let value=this.state.value;
         value===0
     }
    render() { 
        return ( <div>
            <button  className="btn btn-primary sm m-2">{this.state.value}</button>
            <button className="btn btn-secondary sm m-2">Increment</button>
            <button className="btn btn-secondary sm m-2">Decrement</button>

        </div> 
        );
    }
}
